#include "lib/FastNoiseLite.h"
#include <random>

using namespace std;


const int screen_width = 1200;
const int screen_height = 1200;
const int pixel_channel = 4;
sf::Uint8* pixels = new sf::Uint8[screen_width * screen_height * pixel_channel];


//Figure out how to add seeds to both objects of noisemaps,
//Seed have to be dependent on one another

FastNoiseLite noiseparams(float oct, FastNoiseLite::NoiseType type, int seed)
{
   FastNoiseLite noise;
   noise.SetSeed(seed);
   noise.SetNoiseType(type);
   noise.SetFractalLacunarity(3.0f);
   noise.SetFractalGain(0.4f);
   noise.SetFrequency(0.01f);
   noise.SetFractalOctaves(oct);
   noise.SetFractalType(noise.FractalType_FBm);
   return noise;
}




void regen(FastNoiseLite noise1_obj, FastNoiseLite noise2_obj, FastNoiseLite noise3_obj)
{
    uint8_t * pixel = new uint8_t[screen_width * screen_height * pixel_channel];

    //Draw Pixels
    std::vector<int[screen_width]> arr(screen_height);
    std::vector<int[screen_width]> arr1(screen_height);
    std::vector<int[screen_width]> arr2(screen_height);


    for(int i = 0; i < screen_height; ++i)
    {
        for(int j = 0; j < screen_width; ++j)
        {
            double temp = noise1_obj.GetNoise((float)j, (float)i);
            double humidity = noise2_obj.GetNoise((float)j, (float)i);
            double alt = noise3_obj.GetNoise((float)j, (float)i);

            //double average = (temp + humidity + alt) / 2.0;
            humidity = (humidity + 1.0) / 2.0;
            //std::cout<<humidity<<"\n";


            //Deep water
            if(alt < 0.1)
            {
                arr[i][j] = {8};
                arr1[i][j] = {82};
                arr2[i][j] = {197};
            }

            //Shallow water
            else if (alt < 0.2)
            {
                arr[i][j] = {31};
                arr1[i][j] = {144};
                arr2[i][j] = {253};
            }

            //Sand area
            else if (alt < 0.26)
            {
                arr[i][j] = {234};
                arr1[i][j] = {207};
                arr2[i][j] = {164};
            }
            
            //Other Biomes
            else if (alt < 0.8)
            {
                //Grass
                if (temp < 0.9 && humidity < 0.6)
                {
                    arr[i][j] = {33};
                    arr1[i][j] = {139};
                    arr2[i][j] = {33}; 
                }
            }
            //Green Area
            // else if (final_noise <= 0.65 )
            // {
            //     arr[i][j] = {33};
            //     arr1[i][j] = {139};
            //     arr2[i][j] = {33}; 
            // }
            // //Dark Green Area
            // else if (final_noise <= 0.75)
            // {
            //     arr[i][j] = {27};
            //     arr1[i][j] = {117};
            //     arr2[i][j] = {25}; 
            // }
            // //Mountain
            // else if (final_noise <= 0.9)
            // {
            //     arr[i][j] = {102};
            //     arr1[i][j] = {80};
            //     arr2[i][j] = {69}; 
            // }
            // //Dark Mountain
            // else if (final_noise <= 0.95)
            // {
            //     arr[i][j] = {89};
            //     arr1[i][j] = {69};
            //     arr2[i][j] = {50};

            // }
            // //Snow Mountain
            // else
            // {
            //     arr[i][j] = {255};
            //     arr1[i][j] = {255};
            //     arr2[i][j] = {255};
            //     std::cout<< final_noise<<std::flush<<std::endl;
            // }


            //Convert 2d representation of each index to 1d
            int CurrentPixelIndex2 = ((i * screen_height) + j);
            pixel[4 * CurrentPixelIndex2] = arr[i][j];
            pixel[4 * CurrentPixelIndex2 +1] = arr1[i][j];
            pixel[4 * CurrentPixelIndex2 +2] = arr2[i][j];
            pixel[4 * CurrentPixelIndex2 +3] = 255;
        }
    }
    for(int32_t i = 0; i < screen_width*screen_height*pixel_channel; i+=pixel_channel)
    {
        pixels[i] = pixel[i];
        pixels[i+1] = pixel[i+1];
        pixels[i+2] = pixel[i+2];
        pixels[i+3] = pixel[i+3];
    }
}


void create() 
{
    //Seed creation
    random_device rd;   // non-deterministic generator
    mt19937 gen(rd());
    int seed1 = gen();
    srand48(seed1);
    int seed2 = rand();
    srand48(seed2);
    int seed3 = rand();

    //Noise maps
    FastNoiseLite tempreture = noiseparams(4.0f, FastNoiseLite::NoiseType::NoiseType_Perlin, seed1);
    FastNoiseLite humidity = noiseparams(4.0f, FastNoiseLite::NoiseType::NoiseType_Perlin, seed2);
    FastNoiseLite altitude = noiseparams(4.0f, FastNoiseLite::NoiseType::NoiseType_Perlin, seed3);
}


int main()
{
    //window renderer
    sf::RenderWindow window(sf::VideoMode(screen_width, screen_height), "Procedural Generation");
    window.setVerticalSyncEnabled(true);


    //Texture
    sf::Texture Texture;
    Texture.create(screen_width, screen_height);


    //Sprite
    sf::Sprite sprite(Texture);


    //Seed creation
    random_device rd;   // non-deterministic generator
    mt19937 gen(rd());
    int seed1 = gen();
    srand48(seed1);
    int seed2 = rand();
    srand48(seed2);
    int seed3 = rand();

    //Noise maps
    FastNoiseLite tempreture = noiseparams(4.0f, FastNoiseLite::NoiseType::NoiseType_Perlin, seed1);
    FastNoiseLite humidity = noiseparams(4.0f, FastNoiseLite::NoiseType::NoiseType_Perlin, seed2);
    FastNoiseLite altitude = noiseparams(4.0f, FastNoiseLite::NoiseType::NoiseType_Perlin, seed3);


    regen(tempreture, humidity, altitude);

    while (window.isOpen()) //Main Game Loop
    {

        sf::Event event;
        while (window.pollEvent(event))
        {

            if (event.type == sf::Event::Closed)
                window.close();
            
            if(event.type == sf::Event::KeyReleased && event.key.code == sf::Keyboard::Space)
                regen(tempreture, humidity, altitude);
            
            if(event.type == sf::Event::KeyReleased && event.key.code == sf::Keyboard::Enter)
                regen(tempreture, humidity, altitude);
        
            if(event.type == sf::Event::Resized) 
            {
                sf::FloatRect visibleArea(0.f, 0.f, event.size.width, event.size.height);
                window.setView(sf::View(visibleArea));
            }

        }
        Texture.update(pixels);
        window.clear();
        window.draw(sprite);
        window.display();
    }
    cout<<seed1<<endl;
    //cout<<seed2<<endl;
    //cout<<seed3<<endl;
    return 0;
}

