//workspace

inline void solve(){
	ll x, l, r;

	cin >> x >> l >> r;
	ll ans = 0;
	for (ll i=1,__=sqrt(sqrt(x))+1e4;i<=__;++i){
		for (ll j=i+1;i*j*(j+1)*(j+2)<=x;++j){
			ll ij = i*j;
			// find maxc(k)
			__int128_t lb = j, rb = x / ij;
			while (lb < rb){
				__int128_t m = (lb + rb + 1) / 2;
				if (i * j * m * (m+1) <= x) lb = m;
				else rb = m-1;
			}
			if (lb == j) break;
			ll maxc = lb;
			if (i * j * maxc > INT_MAX) cerr << i << ' ' << j << ' ' << maxc << '\n';

			// ij as cd
			if (l <= i+j && i+j < r){
				ans = (ans + maxc - j) % mod; 
			}
			// ik as cd
			// find upper bound of k
			lb = max((ll)j, l - i - 1); rb = min(maxc, r - i - 1);
			while (lb < rb){
				__int128_t m = (lb + rb + 1) / 2;
				if (i * j * m * (m+1) <= x) lb = m;
				else rb = m-1;
			}
			if (min(maxc, r - i - 1) > max((ll)j, l-i-1)) ans = (ans + min(maxc, r - i - 1) - max((ll)j, l-i-1)) % mod;

			// jk as cd
			// find upper bound of k
			lb = max((ll)j, l - j - 1); rb = min(maxc, r - j - 1);
			while (lb < rb){
				__int128_t m = (lb + rb + 1) / 2;
				if (i * j * m * (m+1) <= x) lb = m;
				else rb = m-1;
			}
			if (min(maxc, r - j - 1) > max((ll)j, l-j-1)) ans = (ans + min(maxc, r - j - 1) - max((ll)j, l-j-1)) % mod;

			// il as cd
			// find upper bound of k
			lb = j; rb = maxc;
			while (lb < rb){
				__int128_t m = (lb + rb + 1) / 2;
				if (i + x / (i * j * m) >= l) lb = m;
				else rb = m-1;
			}
			ll ub = lb;
			// find lower bound of k
			lb = j+1; rb = maxc+1;
			while (lb < rb){
				__int128_t m = (lb + rb) / 2;
				if (i + x / (i * j * m) < r) rb = m;
				else lb = m+1;
			}
			if (lb <= ub) ans = (ans - lb + ub + 1) % mod;

			// jl as cd
			// find upper bound of k
			lb = j; rb = maxc;
			while (lb < rb){
				__int128_t m = (lb + rb + 1) / 2;
				if (j + x / (i * j * m) >= l) lb = m;
				else rb = m-1;
			}
			ub = lb;
			// find lower bound of k
			lb = j+1; rb = maxc+1;
			while (lb < rb){
				__int128_t m = (lb + rb) / 2;
				if (j + x / (i * j * m) < r) rb = m;
				else lb = m+1;
			}
			if (lb <= ub) ans = (ans - lb + ub + 1) % mod;

			// kl as cd
			// find upper bound of k
			lb = j; rb = maxc;
			while (lb < rb){
				__int128_t m = (lb + rb + 1) / 2;
				if (m + x / (i * j * m) >= l) lb = m;
				else rb = m-1;
			}
			//cout << i << ' ' << j << ' ' << lb << ' ' << rb << '\n';
			ub = lb;
			// find lower bound of k
			lb = j+1; rb = maxc+1;
			while (lb < rb){
				__int128_t m = (lb + rb) / 2;
				if (m + x / (i * j * m) < r) rb = m;
				else lb = m+1;
			}
			//cout << i << ' ' << j << ' ' << lb << ' ' << rb << '\n';
			if (lb <= ub) ans = (ans - lb + ub + 1) % mod;
		}
	}

	cout << (ans + mod) * 4 % mod;
}

