const int PIN_LED3 = 6;     // die Nummer des Pins LED-3 (blau)
const int PIN_LED4 = 7;     // die Nummer des Pins LED-4 (gelb)

void setup() {
  // es wird die blaue LED als Ausgang initialisiert (Pin 6)
  pinMode(PIN_LED3, OUTPUT);
}
 
// die loop-Funktion ist eine "Endlosschleife"
void loop() {
  digitalWrite(PIN_LED3, HIGH);   // LED ein (5V über Vorwiderstand am Pin 6 auf HIGH)
  delay(1000);                    // 1 Sekunde Pause
  digitalWrite(PIN_LED3, LOW);    // LED aus (5V über Vorwiderstand am Pin 6 auf LOW)
  delay(1000);                    // 1 Sekunde Pause
}

/*
 * Beispiel:  LED mit Taster schalten
 * Autor:     Frank Schmidt
 * Datum:     07/10/20229
 * Hinweis:   Basierend auf dem "Arduino Button"-Beispiel auf arduino.cc
 *            Angepasst auf "Open Smart Shield V1" 
 */

const int PIN_BUTTON1 = 8;  // die Nummer des Pins Taster-1
const int PIN_BUTTON2 = 9;  // die Nummer des Pins Taster-2
const int PIN_LED1 = 4;     // die Nummer des Pins LED-1 (rot)
const int PIN_LED2 = 6;     // die Nummer des Pins LED-2 (blau)

int buttonState1 = 0;       // den Status von Taster-1 verfolgen
int buttonState2 = 0;       // den Status von Taster-2 verfolgen

void setup()
{
    pinMode(PIN_LED1, OUTPUT);
    pinMode(PIN_LED2, OUTPUT);
    // Auf dem "Open Smart Shield" sind die Tasten ohne externen Pullup-Widerstand 
    // angeschlossen, also sagen Sie der MCU, dass sie einen internen Pullup-Widerstand 
    // verwenden soll.
    pinMode(PIN_BUTTON1, INPUT_PULLUP); 
    pinMode(PIN_BUTTON2, INPUT_PULLUP); 
}

void loop()
{
    // Lesen den Status der Taste-1
    buttonState1 = digitalRead(PIN_BUTTON1);
    // Lesen Sie den Status der Taste-2
    buttonState2 = digitalRead(PIN_BUTTON2);
    
    if (buttonState1 == LOW) {
        // schalten die LED-1 ein (die Taste-1 ist aktiv LOW)
        digitalWrite(PIN_LED1, HIGH);
    } else {
        // schalte die LED-1 aus
        digitalWrite(PIN_LED1, LOW);
    }

    if (buttonState2 == LOW) {
        // schalten die LED-2 ein (die Taste-2 ist aktiv LOW)
        digitalWrite(PIN_LED2, HIGH);
    } else {
        // schalte die LED-2 aus
        digitalWrite(PIN_LED2, LOW);
    }
}

class Solution:
    def fill(self, n, m, mat):
        # Use the input matrix itself as the visited array
        # Mark all 'O' cells that are on the border of the matrix with '#'
        for i in range(n):
            if mat[i][0] == 'O':
                mat[i][0] = '#'
            if mat[i][m - 1] == 'O':
                mat[i][m - 1] = '#'
        for j in range(m):
            if mat[0][j] == 'O':
                mat[0][j] = '#'
            if mat[n - 1][j] == 'O':
                mat[n - 1][j] = '#'

        # Use a BFS approach to mark all 'O' cells that are connected to the border cells with '#'
        queue = []
        for i in range(n):
            for j in range(m):
                if mat[i][j] == '#':
                    queue.append((i, j))

        while queue:
            i, j = queue.pop(0)

            for di, dj in [(-1, 0), (1, 0), (0, -1), (0, 1)]:
                new_i = i + di
                new_j = j + dj
                if 0 <= new_i < n and 0 <= new_j < m and mat[new_i][new_j] == 'O':
                    mat[new_i][new_j] = '#'
                    queue.append((new_i, new_j))

        # Replace all 'O' cells that are not marked with 'X'
        # Restore the marked cells back to 'O'
        for i in range(n):
            for j in range(m):
                if mat[i][j] == '#':
                    mat[i][j] = 'O'
                else:
                    mat[i][j] = 'X'

        return mat

